import React from 'react';
import {View, Text, Button} from 'react-native';

const FunScreen = ({navigation}) => {
    return (
        <View>
            <Text>FunScreen</Text>
            <Button onPress={() => navigation.navigate("Home")}>About</Button>
        </View>
    );
};

export default FunScreen;
